import { Component } from "react";
import "./index.css";

export default class Home extends Component {
    render() {
        return (
            <div className="page">
                <div className="page-item">
                    <div className="item-left">
                        <div className="item-image"></div>
                    </div>
                    <div className="item-right">
                        <div className="item-title">毛泽东传（全6卷）</div>
                        <div className="item-author">中共中央文献研究室</div>
                        <div className="item-number">5135</div>
                        <div className="item-brief">本书的主要依据是中央档案馆保存的毛泽东同志的文稿、电报、书信、讲话记录和他所参加的会议等大量记录，同时，参考了同毛泽东同志有过直接接触的同志的访问记录、回忆录和当时的报刊资料。</div>
                    </div>
                </div>
            </div>
        )
    }
}
